import ExpenseItem from "./components/ExpenseItem";
function App() {
    const expenses = [
        {id:'e1', title : 'Car Insurance1', amount : 294.67, date : new Date(2021,10,11)},
        {id:'e2', title : 'Car Insurance2', amount : 293.67, date : new Date(2022,7,13)},
        {id:'e3', title : 'Car Insurance3', amount : 292.67, date : new Date(2023,7,12)},
        {id:'e4', title : 'Car Insurance4', amount : 291.67, date : new Date(2024,7,15)},
        {id:'e5', title : 'Car Insurance5', amount : 290.67, date : new Date(2025,7,16)},
    ]
  return (
    <div>
        <h2>Let's get started</h2>
        <ExpenseItem title={expenses[0].title} amount={expenses[0].amount} date={expenses[0].date}/>
        <ExpenseItem title={expenses[1].title} amount={expenses[1].amount} date={expenses[1].date}/>
        <ExpenseItem title={expenses[2].title} amount={expenses[2].amount} date={expenses[2].date}/>
        <ExpenseItem title={expenses[3].title} amount={expenses[3].amount} date={expenses[3].date}/>
        <ExpenseItem title={expenses[4].title} amount={expenses[4].amount} date={expenses[4].date}/>
    </div>
  );
}

export default App;
